import Hero from './components/Hero/Hero'
import SearchForm from './components/SearchForm/SearchForm'
const App = () => {
  return (
    <div>
      <h1>My first React App</h1>
      <p>A simple to-do app, with lists, columns and card</p>
      <form>
        <input type="text" />
        <button>Search</button>
      </form>
    </div>
  );
};

export default App;
